import React from "react";
import "./Meme.css"


function Meme(props) {


    return(
        <div id = "memeWrapper">
            <img

                alt = "Dank Meme"
                src = {props.data.img}
                onLoad = {() => props.handleLoad("hidden", "visible")}
            />

            <h2 className = "memeTopText"> {props.topText} </h2>

            <h2 className = "memeBottomText"> {props.bottomText} </h2>
        </div>
    );
}

export default Meme;
